import React from "react";
import Head from "next/head";
import HealthArticle from "../health-article/health-article";

export default function Index(props) {
	return (
		<>
			<Head>
				<title>Protalk App</title>
				<link rel="icon" href="/favicon.ico" />
				<meta
					httpEquiv="Content-Type"
					content="text/html;charset=ut-8"
				/>
				<meta
					name="description"
					content="There are many cohort studies that have shown people who eat less fiber are at high risk for developing Crohn’s disease,” Kaplan says. One of the most robust of these studies was a 2013 report from researchers at Harvard Medical School that looked at diet and health data collected from roughly 170,000 women over a period of more than 26 years. It found that those women who landed in the top fifth of the population in terms of fiber intakes were 40% less likely to have been diagnosed with Crohn’s disease than women who landed in the bottom fifth"
				/>
				<meta
					name="viewport"
					content="initial-scale=1.0, width=device-width"
				/>
			</Head>
			<div>
				<HealthArticle blog_content={props.content} />
			</div>
		</>
	);
}
export const getStaticProps = async () => {
	const res = await fetch(
		"https://run.mocky.io/v3/43f83c21-8678-4e6e-8e95-2725d9a51d03"
	);
	const data = await res.text();
	return {
		props: { content: data }
	};
};
